                        "Desc": "让众生的心愿，成为照亮大地的月光。菈乌玛默咏终北的圣歌，并获得18层<color style='color:#FFD780;'>「苍色祷歌」</color>。<br>此外，菈乌玛在拥有「月咏」的情况下施放元素爆发时，或是在施放元素爆发后的15秒内获得「月咏」时，菈乌玛将消耗所有的「月咏」，并依据消耗的层数，每层使菈乌玛获得6层「苍色祷歌」。每次施放元素爆发以及施放元素爆发后的15秒内，该效果至多触发一次。<br><br><color style='color:#FFD780;'>苍色祷歌</color><br>队伍中的角色造成绽放、超绽放、烈绽放、月绽放反应伤害时，将消耗一层「苍色祷歌」，提升造成的伤害，提升值基于菈乌玛的元素精通。上述伤害同时命中多名敌人时，会依据命中敌人的数量消耗「苍色祷歌」层数。<br>每层「苍色祷歌」独立计算持续时间。",
